import React, {Component} from 'react'
import Papa from 'papaparse'
import * as d3 from 'd3';
import data from './crypto_historical_data.csv';


class App extends Component {
    
    constructor(props) {
        super(props)
    }

    componentDidMount() {

        d3.csv(data).then(function(data) {
            console.log(data)
        }).catch(function(err) {
            throw err;
        })
    }
        
    render(){
        return (
            <div className = "App">
                <div> Data Visualization </div> 
            </div>
        );
    }
        
    
}
export default App
